Lockheed AC-130 — важкоозброєний літак підтримки сухопутних підрозділів. Базою для даної моделі є транспортний літак C-130 фірми Lockheed. Установку озброєння та додаткового обладнання здійснювала фірма Боїнг. Брав активну участь у В'єтнамській війні. Літак призначений для вирішення наступних завдань: 
* безпосередня авіаційна підтримка військ; 
* патрулювання і порушення комунікацій противника; 
* завдавання ударів по заздалегідь виявлених об'єктах противника або ж по об'єктах, цілевказування по яких надходить під час патрулювання (знаходження у повітрі); 
* забезпечення оборони своїх баз і важливих об'єктів. У загалом було розроблено 99 модифікацій АС-130, які відрізнялися набором артилерійсько-кулеметного озброєння і радіотехнічних засобів. Екіпаж літака АС-130 включає п'ять офіцерів (два пілоти, штурман, оператор бортових систем артозброєння і оператор систем РЕБ) і вісім рядових (бортінженер, оператор ТБ-камер, оператор ІЧ-апаратури, і чотири стрільці). В даний час на озброєнні Командування спеціальних операцій ВПС США знаходиться: 
* 8 літаків AC-130H (англ. Spectre — 'привид') — вартість одного $132,4 млн. 
* 13 літаків AC-130U (англ. Spooky — 'страшний, жахливий') — вартість одного $190 млн. (2002 р.)
